var input_array = input.split('_')

var idSum = 0
var i = 0
var alphabet = "a b c d e f g h i j k l m n o p q r s t u v w x y z".split(' ')
var alphabetString = "abcdefghijklmnopqrstuvwxyz"

for (i = 0 ; i < input_array.length ; i++) {
    var alphabetMark = {}

    var roomName = input_array[i].split('-')
    
    var realRoom = true
    var roomLetters = roomName[roomName.length-1].match( /[a-zA-Z]+/g )[0]
    var roomId = roomName[roomName.length-1].match( /\d+/g )[0]
    roomName.pop()
    roomName = roomName.join('')
    
    var j = 0;
    for (j = 0; j <= alphabet.length-1 ; j++) {
        let letter = alphabet[j]
        if (roomName.indexOf(letter) < 0) {
            if (roomLetters.indexOf(letter) > -1) {
                realRoom = false
                break
            }
        } else {
            alphabetMark[letter] = (roomName.split(letter).length-1)
        }
    }

    if (!realRoom) {
        continue
    }

    for (let k = 0 ; k < roomLetters.length ; k++) {
        let arrayToCheck = Object.assign({}, alphabetMark)
        let letterToCheck = roomLetters[k]
        if (checkLetter(letterToCheck, arrayToCheck[letterToCheck], arrayToCheck)) {
            delete alphabetMark[letterToCheck]
        } else {
            realRoom = false
            break
        }
    }

    if (!realRoom) {
        continue
    }

    // idSum = +idSum + +roomId
    let roomNameShifted = roomName
    for (let m = 0 ; m < +roomId ; m++) {
        roomNameShifted = shiftLetterOneTime(roomNameShifted)
    }
    console.log(roomNameShifted + " - " + roomId)
}
// console.log(idSum)


function shiftLetterOneTime(stringToShift) {
    let stringArray = stringToShift.split('')
    for (let i = 0 ; i < stringArray.length ; i++) {
        stringArray[i] = getAlphabetIndex(stringArray[i])
    }
    return stringArray.join('')
}

function getAlphabetIndex(letter) {
    if (letter == 'z') {
        return 'a'
    } else {
        let index = alphabetString.indexOf(letter)
        return alphabetString[index + 1]
    }
}

function checkLetter(letter, value, arrayToCheck) {
    let maxValue = getMax(arrayToCheck)
    if (maxValue == letter) {
        return true
    } else {
        if (arrayToCheck[maxValue] == value) {
            delete arrayToCheck[maxValue]
            return checkLetter(letter, value, arrayToCheck)
        } else {
            return false
        }
    }
}

function getMax(obj) {
    return Object.keys(obj).reduce((a, b) => obj[a] > obj[b] ? a : b)
}


